An Allied Artists low-budgeter based on the life of the warden who first introduced reforms in the infamous California penal institution. Appalled by conditions in San Quentin, the grey-haired Duffy inaugurates a series of improvements. He also sets up an honor system, which brings him under fire from conservative law enforcement agencies.


